import React, { Component } from 'react';
import './App.css';
import {  BrowserRouter, NavLink, Route, Link } from "react-router-dom";

import berry from './images/gooseberry.png'
import water from './images/water.jpeg'
import ginger from './images/ginger.jpg'
import coffee from './images/coffee.jpg'
import tea from './images/tea.jpeg'
import washcloth from './images/washcloth.jpeg'
import honey from './images/honey.jpg'
import watermelon from './images/watermelon.jpg'
import aromatherapy from './images/aromatherapy.jpg'
import vitamind from './images/vitamind.jpg'

const illnesses = [{text:"Common cold", label:"./pages/Cold.js", rating:"3", reviews:"10", img:<img class="icon" src={water} alt="water"/>},
  {text:"Nausea", label:"./pages/Cold.js", rating:"2", reviews:"15", img:<img class="icon" src={ginger} alt="ginger"/>},
  {text:"Mental Health", label:"./pages/Cold.js",  rating:"5", reviews:"3", img:<img class="icon" src={tea} alt="tea"/>},
  {text:"Migraines", label:"./pages/Cold.js",  rating:"3", reviews:"1", img:<img class="icon" src={coffee} alt="coffee"/>},
  {text:"Digestive Disorders", label:"./pages/Cold.js",  rating:"2", reviews:"3", img:<img class="icon" src={honey} alt="honey"/>},
  {text:"Eye health", label:"./pages/Cold.js",  rating:"1", reviews:"6", img:<img class="icon" src={washcloth} alt="washcloth"/>},
  {text:"Kidney Stones", label:"./pages/Cold.js",  rating:"4", reviews:"13"},
  {text:"Acne", label:"./pages/Acne.js",  rating:"5", reviews:"12", img:<img class="icon" src={berry} alt="gooseberry"/>},
  {text:"Menstrual health", label:"./pages/Cold.js",  rating:"2", reviews:"18", img:<img class="icon" src={vitamind} alt="vitamind"/>},
  {text:"Osteoporasis", label:"./pages/Cold.js",  rating:"1", reviews:"4"},
  {text:"Sleep Disorders", label:"./pages/Cold.js",  rating:"3", reviews:"10", img:<img class="icon" src={aromatherapy} alt="aromatherapy"/>}];
const list = illnesses.map((illness) =>
  <tr><NavLink to={illness.label}>
    <td>{illness.img}</td>
    <td><h2 class="title"><strong>{illness.text}</strong></h2></td>
    <td><p class="detail"><strong>Rating:</strong> {illness.rating}/5</p></td>
    <td><p class="detail"><strong>Reviews:</strong> {illness.reviews}</p></td>
  </NavLink></tr>
);

class Table extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>List of Illnesses</h1>
          <table className="table hover">
            <thead></thead>
            <tbody>{list}</tbody>
          </table>
        </header>
      </div>
    );
  }
}

export default Table;
